campaignTrail_temp.questions_json = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 717, \"fields\": {\"priority\": 1, \"description\": \"March 2023: You and your Party Co-Leader, Annalena Baerbock, want to decide together who will be the Green Party chancellor candidate in around a month. Until then, what do you want to do to prepare for the upcoming election season?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 718, \"fields\": {\"priority\": 1, \"description\": \"The Corona Pandemic is the topic that is dominating the news and political discourse right now. With the Greens not governing on the federal level, you can do little in terms of actual policy though. What’s something you want to focus on concerning COVID policies?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 719, \"fields\": {\"priority\": 1, \"description\": \"April 2021: You’ve come to an agreement with your co-party leader Baerbock. In a bit of a surprise to you, she told you that she has no interest in become chancellor candidate and wants to support you. Now, it’s time for your first speech as official Green chancellor candidate!\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 720, \"fields\": {\"priority\": 1, \"description\": \"After a messy leadership contest, the CDU has - somewhat unexpectedly - chosen Markus Söder as their chancellor candidate and immediately somewhat surged in the polls. With this, you, the CDU/CSU and the SPD have all chosen a chancellor candidate. Now it's time to decide on a general strategy for this pivotal race.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 721, \"fields\": {\"priority\": 1, \"description\": \"With a Green chancellor now looking like a realistic option, many are curious about your foreign policy. Can you clarify your position on that?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 722, \"fields\": {\"priority\": 1, \"description\": \"May 2021: The Federal Constitutional Court just ruled the Climate Protection Act as unconstitutional and demands the government do more to lower emissions. The federal government in Berlin is now working on passing a stricter law. While the government can pass the law without Green Party votes, the media is still interested in your position.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 723, \"fields\": {\"priority\": 1, \"description\": \"After announcing your candidacy, you’ve received some criticism from within the party for stealing the nomination from a woman - in general, the Green Party is very in favour of giving top jobs to women if possible. How do you want to address these allegations?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 724, \"fields\": {\"priority\": 1, \"description\": \"In the past, you’ve been criticized for some rather bizarre statements you made on Twitter, like calling Bavaria a one-party state or talking about bringing democracy to Thuringia. In response, you deleted your social media presence. Do you have anything to say about this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 725, \"fields\": {\"priority\": 1, \"description\": \"Time and time again, the Green Party has said that more needs to be done about climate change. In an interview, you are now asked what this means concretely for the price of gasoline.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 726, \"fields\": {\"priority\": 1, \"description\": \"June 2021: As the election comes closer, many voters are giving you a closer look. In the last years, the Green Party hasacquired the reputation of being an elitist party for educated and rich people. You’ve studied Philosphy and Philology, giving your opponent an opening to call you an ivory-tower intellectual. How do you want to combat this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 727, \"fields\": {\"priority\": 1, \"description\": \"Since 2005, long-time unemployed people in Germany get money from the state at the subsistence level, the so-called Hartz IV. However, they receive less money if they are not looking for a job. Many people are not happy with this system - what does the Green Party want to change?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 728, \"fields\": {\"priority\": 1, \"description\": \"A policy field which has been a surprisingly big topic this election - likely due to the Covid pandemic and subsequent lockdowns - is digitalization. What plans does the Green Party have?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 729, \"fields\": {\"priority\": 1, \"description\": \"One possible measure to reduce carbon emissions that has been suggested by your party again and again is a general speed limit on the German Autobahn. You’re asked to clarify your position in an interview.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 730, \"fields\": {\"priority\": 1, \"description\": \"July 2021: There’s some trouble with your co-party leader Baerbock. In the past weeks, she has admitted to forgetting to report payments she got and having a misleading CV. Now, a book she published allegedly contains plagiatized passages. What’s your comment on this situation?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 731, \"fields\": {\"priority\": 1, \"description\": \"Widespread flooding is affecting large areas of western, southern and middle Germany. Other politicians, like Laschet, are travelling to the affected areas. Do you want to go there too?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 732, \"fields\": {\"priority\": 1, \"description\": \"After the devastating floodings, climate change is once again a much-discussed topic in the media and politics. You are expected to make a statement on this topic, did this catastrophe affect your stance?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 733, \"fields\": {\"priority\": 1, \"description\": \"It’s now less than two months until the election, and the campaign is heating up. Is there any specific region you want to focus on until election day?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 734, \"fields\": {\"priority\": 1, \"description\": \"August 2021: The Covid vaccine has become widely available to the whole population this summer. While a lot of people have gotten it already, the vaccination campaign has become sluggish in recent weeks. What should be done about that in your opinion?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 735, \"fields\": {\"priority\": 1, \"description\": \"Throughout the campaign, Olaf Scholz and the SPD have struggled in the polls, and while some people were sceptical of you in the spring, your polling numbers are still good. What’s your strategy for the final few weeks of the campaign?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 736, \"fields\": {\"priority\": 1, \"description\": \"One topic that’s important basically every election season is tax policy. Many people wonder how you want to finance all the new spending you promise - do you want to raise taxes to achieve that?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 737, \"fields\": {\"priority\": 1, \"description\": \"The election is in about a month now, and as usual, there will most probably be a coalition government afterwards. Which parties do you want to talk to?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 738, \"fields\": {\"priority\": 1, \"description\": \"Pictures of the disastrous retreat of NATO troops from Afghanistan go around the globe. The government is sharply criticised for its botched evacuation. What is your opinion on the matter?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 739, \"fields\": {\"priority\": 1, \"description\": \"September 2021: For the first time in German history, a Green Party candidate has been invited to the chancellor debate. In another first, the debate will be three-way, between you, Olaf Scholz of the SPD and Markus Söder of the CSU. Who do you want to focus on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 740, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on Olaf Scholz, vice chancellor and candidate of the SPD. What do you want to attack him on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 741, \"fields\": {\"priority\": 1, \"description\": \"It’s the final days of the campaign now, the election will happen very soon. With whom do you want to campaign in these last few days?\", \"likelihood\": 1.0}}]");
extraQuestions = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 742, \"fields\": {\"priority\": 1, \"description\": \"At first, your return to social media went well, but now you are criticized for a tweet in which you compare Söder to a third-world strongman. This is not the first time you’ve made a bizarre tweet - some years ago, you had implied that Bavaria is a one-party state and Thuringia is not democratic. How do you want to react?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 743, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on Markus Söder, Minister-President of Bavaria and chancellor candidate of the CDU/CSU. What do you want to attack him on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 744, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on presenting your case to the German people without too strong attacks. What are your main points?\", \"likelihood\": 1.0}}]");
campaignTrail_temp.answers_json = JSON.parse("[{\"model\": \"campaign_trail.answer\", \"pk\": 4000, \"fields\": {\"question\": 717, \"description\": \"Two years ago, I deleted my social media accounts. However, in this day and age, you need social media for a successful election campaign. I will reactivate them and start posting!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4001, \"fields\": {\"question\": 717, \"description\": \"If I want to become chancellor, I can’t be dragged down by unnecessary scandals. I’ll make sure my finances are in order and will check if there are any problems with my website or other things on the internet.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4002, \"fields\": {\"question\": 717, \"description\": \"I want to get out there, go to talk shows, give interviews, and generally make sure the German people know me. This should improve both my name recognition and my favourability ratings.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4003, \"fields\": {\"question\": 717, \"description\": \"Friday for Future is capable of mobilizing a massive amount of people. I will visit some demonstrations and meet with their leadership to get them on our side.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4004, \"fields\": {\"question\": 718, \"description\": \"Overall, we support the government’s policy. I will criticize their sometimes chaotic response but also make it clear that we broadly stand behind all necessary measures.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4005, \"fields\": {\"question\": 718, \"description\": \"Since the beginning of the pandemic, there hasn’t been enough of a focus on children and families. We will present a plan to get them back to school quickly and provide financial aid for them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4006, \"fields\": {\"question\": 718, \"description\": \"While the lockdowns were absolutely necessary at the beginning of the pandemic, we should be mindful - there has to be a balance between freedom and safety.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4007, \"fields\": {\"question\": 718, \"description\": \"Every district association of the Green Party is led more competently than this country. We need to do something to combat the lack of ideas on the federal level. The Green Party stands for a new beginning.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4008, \"fields\": {\"question\": 719, \"description\": \"When I was Minister of Agriculture and the Environment in Schleswig-Holstein, I listened to all people and strived to find compromises. As Chancellor, I want to continue this approach!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4009, \"fields\": {\"question\": 719, \"description\": \"Forty years ago, the Green Party was founded to make our politics care more about the environment. more about the environment. Today, I continue in this tradition, as the only candidate that truly takes climate change seriously.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4010, \"fields\": {\"question\": 719, \"description\": \"After eight years of Grand coalition and sixteen years of CDU chancellorship, this country needs change. I’m the right man to give this country the new start it needs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4011, \"fields\": {\"question\": 719, \"description\": \"We have a historic opportunity to win the chancellorship for the Green Party this election. I want to be a chancellor for everyone and promise to focus on sensible reform and proposals.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4012, \"fields\": {\"question\": 720, \"description\": \"It’s clear that the SPD is not going to win this election. I want to present myself as the candidate of the left-of-centre and try to coalesce left-wing voters around the Greens.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4013, \"fields\": {\"question\": 720, \"description\": \"Traditionally, the Greens have been a left-of-centre party. However, to actually win this, we need to draw voters from the CDU, especially with Söder as their nominee.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4014, \"fields\": {\"question\": 720, \"description\": \"Our base is largely young, urban, and well-off. We will put our resources into mobilizing them and getting the youth to turn out his election.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4015, \"fields\": {\"question\": 720, \"description\": \"Our polling numbers in West Germany are great, but we are struggling to even get to 10% in many East German states. There is an untapped voter potential for us there, so let’s focus on East Germany.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4016, \"fields\": {\"question\": 721, \"description\": \"The USA is our strongest ally outside of Europe and we want to increase cooperation with both them and NATO. While we disagree on some things - like the 2% goal - we also want to go further than the current government, by stopping the Nord-Stream 2 pipeline.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4017, \"fields\": {\"question\": 721, \"description\": \"We need a more active foreign policy. While pacifism is still the ideal that should guide us, we have to do more - for example, we should deliver defensive weapons to Ukraine to help the defend themselves against the Russian-backed separatists.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4018, \"fields\": {\"question\": 721, \"description\": \"The Green Party has always been the party of pacifism. We need to drastically reduce our military spending and rethink our relationship with NATO. There are more important things we can spend this money on.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4019, \"fields\": {\"question\": 721, \"description\": \"We don’t want to rock the boat here. I want to reaffirm our commitment to NATO but also emphasize that diplomatic solutions are always preferable to military conflicts.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4020, \"fields\": {\"question\": 722, \"description\": \"We need to reduce our emissions by 70% by 2030 - to achieve that, we have to do a lot. For example, we need to double the tempo of the expansion of renewable energy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4021, \"fields\": {\"question\": 722, \"description\": \"Every democratic party here agrees that something needs to be done, so let’s find solutions together. We want to work with other parties, though they finally have to take the climate crisis seriously!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4022, \"fields\": {\"question\": 722, \"description\": \"For the next government, climate change has to be the top priority. Therefore, we want to form a dedicated ministry for climate policy to coordinate our efforts better.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4023, \"fields\": {\"question\": 722, \"description\": \"The new law the Grand coalition has come up with is simply not enough. We need an end to environmentally-unfriendly subsidies, a higher price for CO2, and to transform the traffic and agricultural sector to achieve the necessary reductions in emissions.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4024, \"fields\": {\"question\": 723, \"description\": \"This was a decision we made together, and Baerbock and I agreed that I would be the most competent candidate. Besides, it’s kinda sexist to say that she should have gotten the nomination just because she’s a woman.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4025, \"fields\": {\"question\": 723, \"description\": \"I recognize that we have a problem with not enough women being in the highest positions of power. That’s why I promise that as chancellor, half of my cabinet will consist of women.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4026, \"fields\": {\"question\": 723, \"description\": \"Annalena Baerbock and I are co-party leaders and will both play an important part in this campaign. She will be mostly responsible for our foreign policy plans, for example.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4027, \"fields\": {\"question\": 723, \"description\": \"It’s important that we stay united as a party if we want to win this election. Annalena Baerbock and I agreed that I should be the candidate, but she will of course have an important post in my cabinet if she wants it.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4028, \"fields\": {\"question\": 724, \"description\": \"It was a wise decision to delete my Twitter account. The platform is not good for political discourse, and the young and cool people are somewhere else anyway.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4029, \"fields\": {\"question\": 724, \"description\": \"I admit that these statements were unfortunate - but they have been blown way out of proportion by the right-wing media. Still, I don’t think returning to Twitter is necessary to get my point across to the German people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4030, \"fields\": {\"question\": 724, \"description\": \"There’s nothing wrong with preferring platforms that allow a more substantive discourse than Twitter. Besides, there are Green Party accounts for people to follow if they really want to use Twitter to stay up to date.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4031, \"fields\": {\"question\": 725, \"description\": \"Unfortunately, if we want to lower our carbon emissions, the price of gasoline has to rise by about 16 cents per litre over the next five years.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4032, \"fields\": {\"question\": 725, \"description\": \"As the price of CO2 rises, so will the price of gasoline. We have to keep an eye on affordability, but a price hike is unavoidable.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4033, \"fields\": {\"question\": 725, \"description\": \"Gas prices have to rise a lot - around 28 cents per litre over the next five years. We need to invest in public transit as well to make individual traffic less attractive overall.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4034, \"fields\": {\"question\": 725, \"description\": \"After the price for CO2 went into effect at the beginning of the year, gas prices have risen by 6 cents per litre already - for now, this is enough.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4035, \"fields\": {\"question\": 726, \"description\": \"This is more of a problem with the whole party than with me personally. I want to focus on our programs that help poor and disadvantaged people in this country to combat this image.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4036, \"fields\": {\"question\": 726, \"description\": \"When I was minister in Schleswig-Holstein, I talked with everyone, even people who would never vote Green. I’ll keep that attitude for the election campaign.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4037, \"fields\": {\"question\": 726, \"description\": \"The Bundestag and politics as a whole have a problem with having mostly people with a university degree. We all need to come together to change this!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4038, \"fields\": {\"question\": 726, \"description\": \"Many people in Germany studied at university, so I don’t see how this makes me out of touch. It’s good if politicians are educated.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4039, \"fields\": {\"question\": 727, \"description\": \"We need to change how benefits are calculated so that everyone is receiving at least 50€ more. Furthermore, there should be no more sanctions if someone isn’t actively looking for a job.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4040, \"fields\": {\"question\": 727, \"description\": \"The current level of Hartz IV is a disgrace. There needs to be a massive raise, by around 200€, and an end to the unnecessary and inhumane sanctions for people not searching for a job.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4041, \"fields\": {\"question\": 727, \"description\": \"Instead of Hartz IV, there should be a higher, universal basic income for all people in Germany. While this is expensive, the savings on bureaucracy make it possible to finance this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4042, \"fields\": {\"question\": 727, \"description\": \"The system needs some minor adjustments - we can look into gradually raising the amount of money paid out but have to be careful that it doesn’t become excessive.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4043, \"fields\": {\"question\": 728, \"description\": \"The Grand coalition has failed Germany in this regard, as was plain to see during the lockdowns. Under a Green government, we will put a lot of resources into modernising the digital infrastructure of this country.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4044, \"fields\": {\"question\": 728, \"description\": \"We have to do a lot more to make our government data transparent. Non-personal data should be made public for all citizens.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4045, \"fields\": {\"question\": 728, \"description\": \"Frankly, it’s embarrassing how much government agencies still rely on old-fashioned methods. We have to make investments here to help them build more modern, digital systems.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4046, \"fields\": {\"question\": 728, \"description\": \"For too long, we have relied on American companies for everything related to digitalization. We need German and European solutions, to be more independent and protect our data better.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4047, \"fields\": {\"question\": 729, \"description\": \"I want to reaffirm our position here -  we need a general tempo limit of 130 km/h to reduce carbon emissions. We have to hit our emission targets somehow and reducing traffic emissions is one part of that.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4048, \"fields\": {\"question\": 729, \"description\": \"We need a tempo limit, yes, but not just for climate reasons: A lot of accidents and deaths could be avoided if people wouldn’t be speeding excessively.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4049, \"fields\": {\"question\": 729, \"description\": \"With a general tempo limit being so unpopular, that is not something we want to focus on in the next legislative session. However, we will look into introducing new tempo limits on selected highways.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4050, \"fields\": {\"question\": 729, \"description\": \"Not only do we need a general tempo limit of 130 km/h on highways, but we also need one of 30 km/h within city limits - that would be a truly effective measure against climate change.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4051, \"fields\": {\"question\": 730, \"description\": \"The last thing I need now is Baerbock dragging me down with her scandals. For the rest of the campaign, I’ll sideline her as much as possible.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4052, \"fields\": {\"question\": 730, \"description\": \"Both Baerbock herself and I admit that she made some mistakes. However, this should not distract us from the more important topics. I want to talk about policies!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4053, \"fields\": {\"question\": 730, \"description\": \"These allegations are unfair and part of a right-wing smear campaign against the Green Party in general. I will fight back and defend Baerbock whenever I’m asked about this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4054, \"fields\": {\"question\": 730, \"description\": \"The CDU/CSU was involved in a massive scandal with many of their MPs selling overpriced medical masks. Scholz of the SPD oversaw the disastrous Wirecard collapse and was involved in corrupt cum-ex banking deals. Compared to that, Baerbock’s missteps are insignificant.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4055, \"fields\": {\"question\": 731, \"description\": \"No, it would be improper to try to politicize this catastrophe. I’m of course making statements supporting all the emergency responders, but I won’t go there myself just to get some pictures.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4056, \"fields\": {\"question\": 731, \"description\": \"I will travel to some of the affected regions, yes. However, I don’t want the press to be around, I just want to talk to some affected people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4057, \"fields\": {\"question\": 731, \"description\": \"Yes, I want to go there. Specifically, I want to go to some affected cities with Green Party mayors. I’ll look at the devastation and make a public statement with them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4058, \"fields\": {\"question\": 731, \"description\": \"Of course, I want to travel there, talk to affected people and show myself as a man of action. I want to show that, when disaster strikes, I’m there for people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4059, \"fields\": {\"question\": 732, \"description\": \"We, the Green Party, have said for decades that we need to do more against climate change to avoid catastrophes like this. That’s why we call, for example, for an end of using coal to produce electricity by 2030.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4060, \"fields\": {\"question\": 732, \"description\": \"I don’t want to come across as wanting to profit from this disaster. Instead of talking about climate change, I will talk about helping the victims in the coming days.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4061, \"fields\": {\"question\": 732, \"description\": \"This catastrophe has shown that we need to do much, much more to prepare for flooding and other extreme weather events. At the same time, we need to do more to reduce our carbon emissions.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4062, \"fields\": {\"question\": 732, \"description\": \"Of course, we need to do more against climate change. I’m happy that Söder is coming around, though I would like to remind people that under his government, Bavaria has barely done anything to combat climate change.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4063, \"fields\": {\"question\": 733, \"description\": \"Our party colleagues in the Saarland had some conflict and didn’t manage to settle on a valid candidate list yet. Let’s help them sort this out.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4064, \"fields\": {\"question\": 733, \"description\": \"Winfried Kretschman, the only Green Minister-President, has just won his reelection this spring and is very popular. I want to campaign with him in Baden-Württemberg and South Germany in general.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4065, \"fields\": {\"question\": 733, \"description\": \"I’m quite content with our polling numbers in West Germany, but we are still far behind in East Germany. I want to focus on this region, both by travelling there and promising do to more to help them catch up.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4066, \"fields\": {\"question\": 733, \"description\": \"The states of Berlin and Mecklenburg-Vorpommern have their state elections parallel to our federal elections. I want to campaign there to help our leading candidates in these elections.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4067, \"fields\": {\"question\": 734, \"description\": \"It is legitimate that unvaccinated people don’t have the same rights and privileges as vaccinated people. Maybe that will help convince everyone to get vaccinated.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4068, \"fields\": {\"question\": 734, \"description\": \"We are doing a lot to get everyone vaccinated right now without thinking about the consequences. What if the vaccine is toxic? We should try some more natural medicine instead.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4069, \"fields\": {\"question\": 734, \"description\": \"At this point, we don’t need mandatory vaccinations yet, though it is something that is probably needed later on if the vaccination rates stay too low.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4070, \"fields\": {\"question\": 734, \"description\": \"Overall, we are on the right path with the vaccination campaign. We need to do more to reach everyone though, including mobile vaccination teams going to areas with low vaccination rates.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4071, \"fields\": {\"question\": 735, \"description\": \"Our main opponent is the CDU, so I will emphasize our moderation and commitment to lead a sensible government. Söder is an opportunist who will say what gets him elected but can’t be trusted in government.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4072, \"fields\": {\"question\": 735, \"description\": \"The SPD is down, but still the party that’s politically most similar to us, so their voters should be easiest to win over. I will make an effort to target them and get them to vote Green this election.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4073, \"fields\": {\"question\": 735, \"description\": \"It looks like the Left party might struggle to reach 5%. I’ll specifically target their voters, maybe we can keep them out of parliament and simplify finding a majority.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4074, \"fields\": {\"question\": 735, \"description\": \"They might be a bit weaker than they were four years ago, but the amount of votes the AfD is projected to receive is still way too high. I’ll try to win over some of their voters.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4075, \"fields\": {\"question\": 736, \"description\": \"To finance necessary government spending, taxes on the rich have to be raised. We should reinstate the wealth tax and raise the income tax, but in a way that leaves small and medium-income earners unaffected.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4076, \"fields\": {\"question\": 736, \"description\": \"Effectively combatting climate change is our number one priority, and to finance this, taxes need to be raised across the board. The wealthy will of course have to bear the highest increase, but unfortunately, everyone will have to contribute more.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4077, \"fields\": {\"question\": 736, \"description\": \"We need to raise taxes on the rich a bit, yes. However, we also need to modify the clause in our constitution that disallows too much government borrowing. It should be possible to take out loans for investments in important projects.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4078, \"fields\": {\"question\": 736, \"description\": \"Well, people are right, all the things we promised to do to combat climate change are very expensive. It’s more important to not raise taxes though, so unfortunately, we have to abandon a lot of those promises and only do what’s affordable with current state income.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4079, \"fields\": {\"question\": 737, \"description\": \"The party we have the most overlap with is the SPD - therefore, I want to form a government with them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4080, \"fields\": {\"question\": 737, \"description\": \"I want to categorically rule out a coalition with the Left party, they are just too far from us on foreign policy. Apart from that, we’ll talk to all democratic parties.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4081, \"fields\": {\"question\": 737, \"description\": \"The only realistic path to a true left-wing government is with the SPD and the Left party. My favourite coalition would be with those two, I’m certain we can find compromises on contentious topics.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4082, \"fields\": {\"question\": 737, \"description\": \"In Schleswig Holstein, I’ve been part of a successful Jamaica coalition. I want a government that takes climate change seriously, but I have nothing against governing with those two parties.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4083, \"fields\": {\"question\": 738, \"description\": \"Both parties in government, the CDU/CSU and the SPD screwed up here. No matter how much they’re blaming each other, the voters will see that we need to move on from both of them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4084, \"fields\": {\"question\": 738, \"description\": \"Right now, it’s important that we don’t instrumentalize this topic for the election, but work to find concrete solutions to help the people. We called for an evacuation last month already, and we need to do something now before it’s too late.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4085, \"fields\": {\"question\": 738, \"description\": \"We need to evacuate as many people from Afghanistan as possible, especially people who cooperated with our troops, journalists and women’s rights activists. They are very endangered after the Taliban takeover.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4086, \"fields\": {\"question\": 738, \"description\": \"The Green Party is a party of pacifism, and we’ve been against this war in Afghanistan from the start. While the pictures are tragic and we need to do what we can to help, this whole episode shows why we shouldn’t get involved in these types of conflicts.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4087, \"fields\": {\"question\": 739, \"description\": \"It will be easier to win over SPD voters, so I will focus on attacking Scholz.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4088, \"fields\": {\"question\": 739, \"description\": \"To win this election, I need to take some voters from Söder. I will focus my attacks on him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4089, \"fields\": {\"question\": 739, \"description\": \"Actually, I don’t want to attack anyone, I want to remain positive and above the fray.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4090, \"fields\": {\"question\": 739, \"description\": \"I’ve been invited to this debate, yes, but I doubt the moderators will give me a fair shake. I refuse to participate!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4091, \"fields\": {\"question\": 740, \"description\": \"He’s the incumbent vice chancellor and has been a part of the Grand coalition for the last four years. People who want real change in this country have to look elsewhere!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4092, \"fields\": {\"question\": 740, \"description\": \"I want to hit him on his scandals, both as finance minister and earlier. He mishandled the Wirecard collapse, was involved in the cum-ex banking scandal and had a disastrous response to the G20 meeting when he was mayor of Hamburg.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4093, \"fields\": {\"question\": 740, \"description\": \"He’s just not as leftwing as he pretends to be now, not on climate change, not on social security. He’s always been known as a moderate, I’ll attack him on not being serious about all the change promised in the SPD program.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4094, \"fields\": {\"question\": 740, \"description\": \"Actually, I’ve changed my mind. I’m just going to present myself as calm and above petty attacks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4095, \"fields\": {\"question\": 741, \"description\": \"Luisa Neubauer, the most famous German Fridays For Future activist, is actually a member of the Green Party. I want to hold some campaign events with her.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4096, \"fields\": {\"question\": 741, \"description\": \"Annalena Baerbock has had some issues during the campaign, but she is the co-party leader and an important figure within the party. I want to campaign with her.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4097, \"fields\": {\"question\": 741, \"description\": \"There will be state elections in Berlin and Mecklenburg-Vorpommern parallel to the federal elections. I want to campaign with Bettina Jarasch in Berlin to help make her the second Green head of state government!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4098, \"fields\": {\"question\": 741, \"description\": \"Winfried Kretschmann is the only Green Minister-President and a very important figure of the moderate wing of our party. I want to campaign with him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4099, \"fields\": {\"question\": 742, \"description\": \"It was a mistake to return to social media - I apologize for the remark and delete my accounts, this time for good.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4100, \"fields\": {\"question\": 742, \"description\": \"First, I want to apologize to Markus Söder, I should have chosen my words better. From now on, I want my twitter account to be run by a team that double-checks my tweets.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4101, \"fields\": {\"question\": 742, \"description\": \"People keep taking my words out of context - they might sound bad if you only here a half-sentence, but overall, I stand by the gist of what I said.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4102, \"fields\": {\"question\": 742, \"description\": \"I recognize that my tweet was inappropriate and apologize for it. However, in this day and age, you need social media, and I will keep using it.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4103, \"fields\": {\"question\": 743, \"description\": \"He’s a political opportunist whose position changes like a flag in the wind. Germany needs a chancellor with strong values, not someone like him!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4104, \"fields\": {\"question\": 743, \"description\": \"The program of his party regarding climate change is very unambitious. In the past, the CDU/CSU has not done enough to combat climate change, and while he likes to present himself as a fighter for climate change, it’s all rhetoric and no substance.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4105, \"fields\": {\"question\": 743, \"description\": \"For the last 16 years, this country has been governed by the CDU/CSU, and they are out of ideas on what to do in government. This country needs change and Söder is not the outsider he claims to be, but a part of the establishment.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4106, \"fields\": {\"question\": 743, \"description\": \"Actually, I’ve changed my mind. I’m just going to present myself as calm and above petty attacks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4107, \"fields\": {\"question\": 744, \"description\": \"The CDU/CSU has been in government for 16 years, the SPD for 8. This country needs change, and I’m a fresh face that can deliver it, unlike the other two candidates.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4108, \"fields\": {\"question\": 744, \"description\": \"There is one issue that really matters in this election: Climate change! I’m the only one to have a program that’s ambitious enough to truly make a difference.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4109, \"fields\": {\"question\": 744, \"description\": \"I’d like to focus on our social policies, like a higher minimum wage, higher taxes for the rich and a reform of the Hartz IV system.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4110, \"fields\": {\"question\": 744, \"description\": \"Actually, screw this! I will attack them both whenever an opportunity presents itself. That way, I can sharpen my profile and show myself as the most competent candidate.\"}}]");
