campaignTrail_temp.answer_feedback_json = JSON.parse("[{\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5000, \"fields\": {\"answer\": 4000, \"candidate\": 79, \"answer_feedback\": \"It’s true that social media is almost expected today, so this probably helps - as long as you avoid posting controversial statements like the ones that made you deactivate your accounts in the first place!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5001, \"fields\": {\"answer\": 4001, \"candidate\": 79, \"answer_feedback\": \"Despite thoroughly searching for potential problems, you just don’t find anything. This feels like a waste of time, especially considering you could have used the time to campaign or do something else more useful.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5002, \"fields\": {\"answer\": 4002, \"candidate\": 79, \"answer_feedback\": \"It helps to be seen, and a few more people get to know you, though most Germans already have an opinion of you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5003, \"fields\": {\"answer\": 4003, \"candidate\": 79, \"answer_feedback\": \"In the past, the Green Party has been criticized by Fridays for Future for not being ambitious enough. This might help mobilise the youth vote, though many people who care about the climate a lot already vote Green.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5004, \"fields\": {\"answer\": 4004, \"candidate\": 79, \"answer_feedback\": \"You don’t make headlines with this stance, but this is broadly popular and you don’t attract any negative attention, as most Germans seem to agree.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5005, \"fields\": {\"answer\": 4005, \"candidate\": 79, \"answer_feedback\": \"This is a decent avenue of attack, many feel that the needs of children have not been adequately met, though you are not the best person to sell this. Young voters are also a core group of your coalition.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5006, \"fields\": {\"answer\": 4006, \"candidate\": 79, \"answer_feedback\": \"The FDP agrees with your position, and you might win over some of their voters - however, many others feel that this might be premature.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5007, \"fields\": {\"answer\": 4007, \"candidate\": 79, \"answer_feedback\": \"Many people agree that this country needs change and this is a damaging attack - it’s unclear though how many people prefer the Green Party as an alternative.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5008, \"fields\": {\"answer\": 4008, \"candidate\": 79, \"answer_feedback\": \"Your time as Minister was widely regarded as a success. The left wing of your party is not happy to hear the word ‘compromise’, though in general, it helps to be seen as pragmatic. With both the CDU and SPD struggling in the polls, many people consider you as the best alternative.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5009, \"fields\": {\"answer\": 4009, \"candidate\": 79, \"answer_feedback\": \"A strong focus on climate change will mobilize your core voters. It’s unclear if that’s enough to win - however, with the CDU and SPD both struggling in the polls, an energized campaign might be the way to go. And as you know - 'There's no way around the climate goals'.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5010, \"fields\": {\"answer\": 4010, \"candidate\": 79, \"answer_feedback\": \"A compelling argument, many voters desire change, and with the CDU and SPD both struggling in the polls right now, you might be able to deliver it in the fall. As you know: 'Future doesn't happen - we're creating it.'\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5011, \"fields\": {\"answer\": 4011, \"candidate\": 79, \"answer_feedback\": \"You seem to gamble that the left, 'Fundi'-wing of the Party is truly dead and that this race is won in the middle. As both big parties, CDU and SPD seem to struggle, there might be an opening to split them apart - but be mindful of your base.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5012, \"fields\": {\"answer\": 4012, \"candidate\": 79, \"answer_feedback\": \"Voters on the Left have traditionally been your base. Some pundits wonder though if such an unexceptional approach is the right way to capitalize on the Greens' newfound polling highs, especially with the SPD down to not much more than their very core voters. Let's hope you're ready for the onslaught of attacks from the right.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5013, \"fields\": {\"answer\": 4013, \"candidate\": 79, \"answer_feedback\": \"The core base of the CDU might be impossible to crack, and attacks from your left follow swiftly. You blunt the impact of Söders’ momentum, though for now, most voters prefer him to you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5014, \"fields\": {\"answer\": 4014, \"candidate\": 79, \"answer_feedback\": \"Your turnout-focused strategy might get more first-time voters and loyal Greens to the polls, but this might not be enough to get you into first place. In the last election, the electorate skewed older, and your core base only netted you around 8.9%.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5015, \"fields\": {\"answer\": 4015, \"candidate\": 79, \"answer_feedback\": \"Until now, the Green Party message didn't seem to resonate with East Germany, though the region is known for low turnout in general. Maybe you can get some people there to vote Green this time?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5016, \"fields\": {\"answer\": 4016, \"candidate\": 79, \"answer_feedback\": \"It seems like you are trying to outflank the CDU with your pro-USA stance. With Söder being criticized for visiting Putin last year, this could be an opening. Just be mindful not to scare off too many voters that are critical of the USA.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5017, \"fields\": {\"answer\": 4017, \"candidate\": 79, \"answer_feedback\": \"In the future, this position will surely be vindicated. For now though, it goes too far for the average voter and especially for the more pacifist-minded part of the electorate that often votes Green.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5018, \"fields\": {\"answer\": 4018, \"candidate\": 79, \"answer_feedback\": \"30 years ago, this would have been a mainstream position within your party. Now, it’s on the fringe, and a worldview too simplistic for the median voter. Even the SPD needles you on your stance towards NATO - you might, however, gain from the Left, if that's your goal.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5019, \"fields\": {\"answer\": 4019, \"candidate\": 79, \"answer_feedback\": \"People really don't know what to make of this vagueness - you also don’t differentiate yourself from other parties. At least you keep some flexibility for future policy.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5020, \"fields\": {\"answer\": 4020, \"candidate\": 79, \"answer_feedback\": \"As expected, you’re strongly pushing for more ambitious plans - this strong statement resonates with the voters who are sympathetic to you and energizes your campaign.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5021, \"fields\": {\"answer\": 4021, \"candidate\": 79, \"answer_feedback\": \"You’re emphasizing consensus here - on the one hand, that might make coalition talks after the election easier, on the other, your core voters hoped for more. At least you make it clear that they need to move towards your position.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5022, \"fields\": {\"answer\": 4022, \"candidate\": 79, \"answer_feedback\": \"There's some talk in the beltway about how practicable it would be to dedicate such a cross-sectional task to one personality, but most just want something to be done. Also, you make some people think that you’ve already given up on becoming chancellor and want to run for climate minister instead.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5023, \"fields\": {\"answer\": 4023, \"candidate\": 79, \"answer_feedback\": \"In general, voters like to hear concrete proposals. While your base likes them a lot, other voters are a lot more sceptical. In the future, you should try to mostly emphasize your more popular proposals.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5024, \"fields\": {\"answer\": 4024, \"candidate\": 79, \"answer_feedback\": \"You’re not helping yourself with these kinds of comments. Baerbock is popular in the party and time and energy that could have been spent on campaigning is now spent on discussing\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5025, \"fields\": {\"answer\": 4025, \"candidate\": 79, \"answer_feedback\": \"A smart pivot, though you avoided addressing the allegations directly. Your base still is soothed by this promise, though some wonder how you want to achieve this when you form a coalition with the more right-wing parties that traditionally don’t have as many strong women.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5026, \"fields\": {\"answer\": 4026, \"candidate\": 79, \"answer_feedback\": \"Baerbock is happy to campaign with you and cooperate, and your base is happy. However, by emphasizing that you are a team so much, you make it harder to stick out as chancellor candidate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5027, \"fields\": {\"answer\": 4027, \"candidate\": 79, \"answer_feedback\": \"While the accusations don’t completely stop, by and large, your party agrees that winning this election is more important than squabbling. Baerbock, for her part, is happy to campaign with you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5028, \"fields\": {\"answer\": 4028, \"candidate\": 79, \"answer_feedback\": \"Perhaps you’re right in your analysis, and there are more important demographics to win over than Twitter users - still, your refusal to use social media hurts your campaign.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5029, \"fields\": {\"answer\": 4029, \"candidate\": 79, \"answer_feedback\": \"Most people don’t like how you’re trying to paint yourself as the victim in this situation and your refusal to use social media hurts your campaign.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5030, \"fields\": {\"answer\": 4030, \"candidate\": 79, \"answer_feedback\": \"From time to time, you get needled for refusing to use the platform, but a Green Party account that posts many of your statements and status updates helps combat the issue.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5031, \"fields\": {\"answer\": 4031, \"candidate\": 79, \"answer_feedback\": \"Environmental organisations agree, though, with gas prices at an all-time high already, this is sharply criticized by many others. The word 'unfortunately' unfortunately just isn't very popular politically.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5032, \"fields\": {\"answer\": 4032, \"candidate\": 79, \"answer_feedback\": \"At least you are trying to hedge the issue and be mindful of the impacts of a higher price, though since you didn’t say a number, a lot of people assume the worst.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5033, \"fields\": {\"answer\": 4033, \"candidate\": 79, \"answer_feedback\": \"Everyone but the most ardent environmentalists is deeply alarmed by that statement - your opponents point out that this would make using a car unaffordable for large parts of the population. Rural voters especially seem to be sceptical towards this stance.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5034, \"fields\": {\"answer\": 4034, \"candidate\": 79, \"answer_feedback\": \"The next day, Friday For Future calls for environmentally minded people to vote for climate lists instead of the Green Party. This will probably hurt you, especially among young people. Here's hoping you can make inroads among groups that turn out more reliably\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5035, \"fields\": {\"answer\": 4035, \"candidate\": 79, \"answer_feedback\": \"You’re making some inroads with these groups, though Söder is winning the favourability battle for voters looking for a ‘man of the people’\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5036, \"fields\": {\"answer\": 4036, \"candidate\": 79, \"answer_feedback\": \"This is good for you, voters generally find you approachable and easy to talk to when you go out to meet them. Hopefully, you can win the favourability battle against Scholz and Söder!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5037, \"fields\": {\"answer\": 4037, \"candidate\": 79, \"answer_feedback\": \"You are not wrong, but the Green Party is seen as the most elitist by many, and you are seen as an example of this.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5038, \"fields\": {\"answer\": 4038, \"candidate\": 79, \"answer_feedback\": \"If you’re trying to sound elitist, this is the way to go. Your core voters don’t mind this as much, but it makes it harder to make inroads, especially among less educated people.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5039, \"fields\": {\"answer\": 4039, \"candidate\": 79, \"answer_feedback\": \"This is somewhat on the left spectrum of the debate, though still palpable for moderates.  It also shouldn’t be a hindrance in coalition talks.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5040, \"fields\": {\"answer\": 4040, \"candidate\": 79, \"answer_feedback\": \"With a proposal and rhetoric like this, you win over some Left Party voters and poorer people - though more moderate people find this too hard to stomach, and conservatives attack you for wanting unchecked government handouts.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5041, \"fields\": {\"answer\": 4041, \"candidate\": 79, \"answer_feedback\": \"Experts doubt your math here and call it impossible to finance. On the whole, this idea is on the fringe and not all that popular.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5042, \"fields\": {\"answer\": 4042, \"candidate\": 79, \"answer_feedback\": \"Rhetoric like this is less leftist than voters are used to from you. Some moderates like this, though people on the left and your own youth wing are less satisfied. Although this isn't entirely out of character, since it was your party who participated in the introduction of Hartz IV under Gerhard Schröder.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5043, \"fields\": {\"answer\": 4043, \"candidate\": 79, \"answer_feedback\": \"It’s good to press the attack here - you were part of the opposition in the last decade and can credibly offer change.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5044, \"fields\": {\"answer\": 4044, \"candidate\": 79, \"answer_feedback\": \"People concerned about data transparency like this. The average voter doesn’t really care, though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5045, \"fields\": {\"answer\": 4045, \"candidate\": 79, \"answer_feedback\": \"Almost everyone agrees, but this includes your opponents; you don't differentiate yourself from the field positively or negatively.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5046, \"fields\": {\"answer\": 4046, \"candidate\": 79, \"answer_feedback\": \"Generally, voters agree, though it’s unclear how much you can actually do to change this situation.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5047, \"fields\": {\"answer\": 4047, \"candidate\": 79, \"answer_feedback\": \"You’ve stuck to your principles here, but this is a divisive topic. The FDP in particular attacks you sharply for it.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5048, \"fields\": {\"answer\": 4048, \"candidate\": 79, \"answer_feedback\": \"While the tempo limit is still divisive, this argument is somewhat more convincing than the pure climate one to the average German.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5049, \"fields\": {\"answer\": 4049, \"candidate\": 79, \"answer_feedback\": \"Your base is very deflated by this, and the SPD and Left party keep advocating for a tempo limit, making you seem spineless.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5050, \"fields\": {\"answer\": 4050, \"candidate\": 79, \"answer_feedback\": \"A general tempo limit on highways is divisive - 30 km/h within city limits is straight-up unpopular. You’ve done yourself no favour with this position.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5051, \"fields\": {\"answer\": 4051, \"candidate\": 79, \"answer_feedback\": \"Both she and your party in general are unhappy about this, especially as some see these allegations as unfair. For the next few weeks, the mood at most party meetings is very subdued.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5052, \"fields\": {\"answer\": 4052, \"candidate\": 79, \"answer_feedback\": \"Since she is not the chancellor candidate, her problems never dominate the front pages for too long. They’re still an annoying distraction for your campaign, though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5053, \"fields\": {\"answer\": 4053, \"candidate\": 79, \"answer_feedback\": \"Baerbock is grateful that you’re sticking up for her, and this helps with party unity. However, this also keeps her scandals in the news cycle for longer, which isn’t helping the party’s image.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5054, \"fields\": {\"answer\": 4054, \"candidate\": 79, \"answer_feedback\": \"This leads to accusations being thrown around between all three parties, dragging down everyone’s favourability numbers. Populists on both sides of the aisle salivate at the mudslinging.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5055, \"fields\": {\"answer\": 4055, \"candidate\": 79, \"answer_feedback\": \"Some people appreciate the restraint, but you’re accused of being unapproachable by others. Söder, in contrast, gets some nice pictures of him in rubber boots and positive media attention.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5056, \"fields\": {\"answer\": 4056, \"candidate\": 79, \"answer_feedback\": \"This helps you a bit locally, but people elsewhere wonder where you are. Söder, in contrast, gets some nice pictures of him in rubber boots and positive media attention.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5057, \"fields\": {\"answer\": 4057, \"candidate\": 79, \"answer_feedback\": \"You get some positive press coverage and good pictures. Meanwhile, Söder gets some nice pictures of him in rubber boots and positive media attention.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5058, \"fields\": {\"answer\": 4058, \"candidate\": 79, \"answer_feedback\": \"You have a good way with people and your visits go very well, allowing you to outshine even Söder, who also visited the affected areas.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5059, \"fields\": {\"answer\": 4059, \"candidate\": 79, \"answer_feedback\": \"Coal-producing regions aren’t happy, but this is nothing new. Other than that, this is fairly well received, and your party sees itself vindicated, though some accuse you of politicizing the situation. Söder also attacks this proposal as unrealistic.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5060, \"fields\": {\"answer\": 4060, \"candidate\": 79, \"answer_feedback\": \"Many feel like you are leaving an opportunity on the table here, with climate change being such a big topic without you having to start the discussion. The affected people appreciate your concerns though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5061, \"fields\": {\"answer\": 4061, \"candidate\": 79, \"answer_feedback\": \"While a few people accuse you of exploiting the catastrophe for political gain, many people agree with this and see you as the most credible party on climate issues at first. However, Söder somewhat steals your thunder with his climate plans.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5062, \"fields\": {\"answer\": 4062, \"candidate\": 79, \"answer_feedback\": \"This attack stings for Söder. He tries to hit back by calling your proposals unrealistic. It’s a bruising exchange, though observers agree that you have the other hand here.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5063, \"fields\": {\"answer\": 4063, \"candidate\": 79, \"answer_feedback\": \"With your help, they manage to finish the list. The Saarland is quite small, but every vote potentially counts, so it’s good that you are eligible there.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5064, \"fields\": {\"answer\": 4064, \"candidate\": 79, \"answer_feedback\": \"Kretschmann’s popularity is an asset in these regions. In a bad development, your state party in the Saarland screwed up their candidate list though, meaning you can’t receive any votes in that state.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5065, \"fields\": {\"answer\": 4065, \"candidate\": 79, \"answer_feedback\": \"Let’s see if you can help your party perform better in these states than usual.  In a bad development, your state party in the Saarland screwed up their candidate list though, meaning you can’t receive any votes in that state.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5066, \"fields\": {\"answer\": 4066, \"candidate\": 79, \"answer_feedback\": \"While these might not be the best strategy for your personal result, the two state parties appreciate your help a lot.  In a bad development, your state party in the Saarland screwed up their candidate list though, meaning you can’t receive any votes in that state.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5067, \"fields\": {\"answer\": 4067, \"candidate\": 79, \"answer_feedback\": \"Broadly, voters agree, though you get attacked by the FDP and elements in your own party for this. Some are worried about this leading to a two-class society.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5068, \"fields\": {\"answer\": 4068, \"candidate\": 79, \"answer_feedback\": \"There is a certain, tiny element of the Green Party that likes this. The rest of your party - as well as voters in general - are wondering if you’ve lost your mind.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5069, \"fields\": {\"answer\": 4069, \"candidate\": 79, \"answer_feedback\": \"Your core voter base is open to this, but compulsory vaccinations are generally unpopular right now, and this statement leaves you wide open for attacks.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5070, \"fields\": {\"answer\": 4070, \"candidate\": 79, \"answer_feedback\": \"This is a sensible proposal that also sets you apart from the other parties.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5071, \"fields\": {\"answer\": 4071, \"candidate\": 79, \"answer_feedback\": \"Söder is very popular, and it helps to attack him to stay in contention - opportunist or not, it isn’t easy to dent his popularity though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5072, \"fields\": {\"answer\": 4072, \"candidate\": 79, \"answer_feedback\": \"A few voters are convinced, but mostly, the SPD is down to their loyal core voters already.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5073, \"fields\": {\"answer\": 4073, \"candidate\": 79, \"answer_feedback\": \"While the amount of votes you gain this way is minimal, this might change the majority calculus after the election. Let’s see if this gambit pays off.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5074, \"fields\": {\"answer\": 4074, \"candidate\": 79, \"answer_feedback\": \"Your motives are admirable, but how exactly do you plan to do that? There are probably no two parties that have as little overlap as you and the AfD. Your efforts will have minimal effects at best and confuse your core base.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5075, \"fields\": {\"answer\": 4075, \"candidate\": 79, \"answer_feedback\": \"Your position is very similar to the SPD`s there. It’s broadly popular on the left spectrum, but you don’t do much to differentiate yourself.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5076, \"fields\": {\"answer\": 4076, \"candidate\": 79, \"answer_feedback\": \"With this position, you’re barely pleasing anyone. Parties on the right attack you for wanting to raise taxes so much, and parties on the left accuse you of being indifferent towards poorer people.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5077, \"fields\": {\"answer\": 4077, \"candidate\": 79, \"answer_feedback\": \"A lot of voters follow your logic. However, since a 2/3rds majority is needed to modify the constitution, others wonder if there is any way for you to actually achieve what you want here.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5078, \"fields\": {\"answer\": 4078, \"candidate\": 79, \"answer_feedback\": \"Your intentions to move towards the middle are good, but giving up your core promise to be the party that actually wants to invest money to do something about climate change will cost you a lot of support.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5079, \"fields\": {\"answer\": 4079, \"candidate\": 79, \"answer_feedback\": \"Your programs share a lot of similarities, but it’s improbable that you’ll get a majority together. People also notice your silence on the Left party.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5080, \"fields\": {\"answer\": 4080, \"candidate\": 79, \"answer_feedback\": \"This takes away an avenue of attack against you, though you might regret it during the coalition talks.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5081, \"fields\": {\"answer\": 4081, \"candidate\": 79, \"answer_feedback\": \"The Left party and more leftwing voters welcome this statement, but you’ve confirmed the worst fears of many moderates. It’s also unclear what compromise you can find on foreign policy with a party that wants to exit NATO.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5082, \"fields\": {\"answer\": 4082, \"candidate\": 79, \"answer_feedback\": \"The Left party criticizes you for preferring right-wing parties to them, and some left-wing voters agree. This eases the concerns of many moderates though and blunts the impact of an anti-Red-Red-Green scare campaign.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5083, \"fields\": {\"answer\": 4083, \"candidate\": 79, \"answer_feedback\": \"With so much mudslinging going on, voters were looking for something more positive - though the government parties still get hurt.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5084, \"fields\": {\"answer\": 4084, \"candidate\": 79, \"answer_feedback\": \"Politicians of the SPD and CDU are accusing each other of being responsible for the failure, while you manage to look pragmatic and sensible.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5085, \"fields\": {\"answer\": 4085, \"candidate\": 79, \"answer_feedback\": \"It’s a good thing to advocate for taking in refugees since the type of person that considers voting for you is in favour of that. It also differentiates you from anti-refugee Söder. However, it’s unclear how you want to actually save those people.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5086, \"fields\": {\"answer\": 4086, \"candidate\": 79, \"answer_feedback\": \"The Green Party voted for the Afghanistan mission and was even part of the government in 2001. This statement by you is attacked as both unproductive and factually wrong.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5087, \"fields\": {\"answer\": 4087, \"candidate\": 79, \"answer_feedback\": \"Let’s see how this goes, hopefully, you can peel off some left-leaning voters.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5088, \"fields\": {\"answer\": 4088, \"candidate\": 79, \"answer_feedback\": \"Let’s see how this goes, hopefully you can weaken his position.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5089, \"fields\": {\"answer\": 4089, \"candidate\": 79, \"answer_feedback\": \"Hopefully, the German people will appreciate your positive strategy.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5090, \"fields\": {\"answer\": 4090, \"candidate\": 79, \"answer_feedback\": \"No one understands why you refuse this historic opportunity. This makes it look to people like the chancellor race being between Scholz and Söder now.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5091, \"fields\": {\"answer\": 4091, \"candidate\": 79, \"answer_feedback\": \"Overall, you are right, but Scholz points out that he doesn’t want to enter a new Grand coalition and his program contains many new ideas for Germany. Overall, you and Söder tie the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5092, \"fields\": {\"answer\": 4092, \"candidate\": 79, \"answer_feedback\": \"These are damaging attacks that really undermine his image as the most competent candidate. Overall, you win the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5093, \"fields\": {\"answer\": 4093, \"candidate\": 79, \"answer_feedback\": \"Ah, leftist infighting, a classic. He and you argue a lot about who has the more ambitious, yet realistic, proposals and in the end, Söder wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5094, \"fields\": {\"answer\": 4094, \"candidate\": 79, \"answer_feedback\": \"Since you haven’t prepared for this strategy, this doesn’t help you. Söder is seen as the winner of the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5095, \"fields\": {\"answer\": 4095, \"candidate\": 79, \"answer_feedback\": \"It takes a lot of convincing to get her to appear with you, but this should help energize the youth vote. Good luck tonight!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5096, \"fields\": {\"answer\": 4096, \"candidate\": 79, \"answer_feedback\": \"You energize your core voters and your party in general but don’t appeal to any specific group by campaigning with her. Good luck tonight!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5097, \"fields\": {\"answer\": 4097, \"candidate\": 79, \"answer_feedback\": \"While this might not be the best option for you electorally, hopefully, you can help her get over the line and finish first. Good luck tonight!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5098, \"fields\": {\"answer\": 4098, \"candidate\": 79, \"answer_feedback\": \"He’s popular with both moderates and in Baden-Württemberg, so that should especially help you there. Good luck tonight!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5099, \"fields\": {\"answer\": 4099, \"candidate\": 79, \"answer_feedback\": \"Deleting your accounts so soon after returning makes you seem indecisive - some voters also question if you’re the right person to represent Germany if you can’t stop yourself from making these statements.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5100, \"fields\": {\"answer\": 4100, \"candidate\": 79, \"answer_feedback\": \"Söder accepts the apology, but this still hurts you. Let’s hope that from now on, you will be stopped before you tweet out something like this.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5101, \"fields\": {\"answer\": 4101, \"candidate\": 79, \"answer_feedback\": \"This reaction is not seen as appropriate by most people, and CDU/CSU politicians attack you harshly over your defamatory comments in the coming days. Your party isn’t amused either and convinces you to have a team check all your tweets before you publish them.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5102, \"fields\": {\"answer\": 4102, \"candidate\": 79, \"answer_feedback\": \"While your apology is accepted, the party is not thrilled about you potentially ruining the campaign with your tweets. After some heated discussion, you agree to a team that checks all your tweets before you publish them.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5103, \"fields\": {\"answer\": 4103, \"candidate\": 79, \"answer_feedback\": \"Söder fights back passionately against this attack, claiming his positions evolve when new information comes along. Overall, he and Scholz tie the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5104, \"fields\": {\"answer\": 4104, \"candidate\": 79, \"answer_feedback\": \"He hits right back, calling your proposals unaffordable and going too far, compared to his realistic proposals. Overall, he gets the better of you and wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5105, \"fields\": {\"answer\": 4105, \"candidate\": 79, \"answer_feedback\": \"A convincing argument, especially considering that many voters want change. However, Söder presents himself as more than just a continuation of the Merkel years. Overall, you and he tie the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5106, \"fields\": {\"answer\": 4106, \"candidate\": 79, \"answer_feedback\": \"Since you haven’t prepared for this strategy, this doesn’t help you. Söder is seen as the winner of the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5107, \"fields\": {\"answer\": 4107, \"candidate\": 79, \"answer_feedback\": \"Some voters prefer stability, but many want to see some change in this country. Overall, you win this debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5108, \"fields\": {\"answer\": 4108, \"candidate\": 79, \"answer_feedback\": \"While you put out a passionate plea, Scholz and especially Söder hit you hard on some of your more unpopular proposals. Overall, Söder is the winner of the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5109, \"fields\": {\"answer\": 4109, \"candidate\": 79, \"answer_feedback\": \"You and Scholz have similar positions here, allowing Söder to get in effective attacks and differentiate himself. Overall, Söder wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5110, \"fields\": {\"answer\": 4110, \"candidate\": 79, \"answer_feedback\": \"You come across as unprepared and overly aggressive. This doesn’t help you at all and overall, Söder wins the debate.\"}}]");
